import React from 'react';
import './Homestyles.css';
import contacts from '../images/contact-lenses.png';
import sunglasses from '../images/sunglasses.png';
import spectacles from '../images/spectacles.png';
import { Link } from 'react-router-dom';
import Cookies from 'js-cookie';

function Home(){
	return (
		<div>
			{alert(Cookies.get())}
			<div className="spacer">
			</div>
			<div className="outerdiv">
				<div className="halfholder">
					<div className="imageholder">
						<Link to="/product/contact_lens"><img src={contacts} className="gallery"/></Link>
					</div>
				</div>
				<div className="halfholder">
					<div className="imageholder">
					<Link to="/product/sunglasses"><img src={sunglasses} className="gallery"/></Link>
					</div>
				</div>
				<div className="halfholder">
					<div className="imageholder">
					<Link to="/product/spectacles"><img src={spectacles} className="gallery"/></Link>
					</div>
				</div>
			</div>
		</div>
	);
}

export default Home;
